import React from 'react';
// components
import Header from './layouts/Header';
import Footer from './layouts/Footer';
function Shop(){
    return(
        <div>
            <Header/>
            <div className="background-homepage">
                <div className="container container-homepage">
                
                </div>
            </div>
            <Footer/>       
        </div>
    )
};
export default Shop;
